public static Query defaultCTQuery()
{
    Query quotationLineCDSQuery = new Query();

    var salesQuotationLineDS = quotationLineCDSQuery.addDataSource(tableNum(SalesQuotationLine));

    LogisticsPostalAddressBaseEntityChangeTrackingHelper::addPostalAddressBasedOnAddressRecIdLink(salesQuotationLineDS, fieldNum(SalesQuotationLine, DeliveryPostalAddress));

    var dimensionAttributeValueSetDS = salesQuotationLineDS.addDataSource(tableNum(DimensionAttributeValueSet));
    dimensionAttributeValueSetDS.joinMode(JoinMode::OuterJoin);
    dimensionAttributeValueSetDS.addLink(fieldNum(SalesQuotationLine, DefaultDimension), fieldNum(DimensionAttributeValueSet, RecId));

    var dimensionAttributeValueCombinationDS = salesQuotationLineDS.addDataSource(tableNum(DimensionAttributeValueCombination));
    dimensionAttributeValueCombinationDS.joinMode(JoinMode::OuterJoin);
    dimensionAttributeValueCombinationDS.addLink(fieldNum(SalesQuotationLine, LedgerDimension), fieldNum(DimensionAttributeValueCombination, RecId));

    var dimensionHierarchyDS = dimensionAttributeValueCombinationDS.addDataSource(tableNum(DimensionHierarchy));
    dimensionHierarchyDS.joinMode(JoinMode::OuterJoin);
    dimensionHierarchyDS.relations(true);

    var categoryDS = salesQuotationLineDS.addDataSource(tableNum(EcoResCategory));
    categoryDS.joinMode(JoinMode::OuterJoin);
    categoryDS.addLink(fieldNum(SalesQuotationLine, IntrastatCommodity), fieldNum(EcoResCategory, RecId));

    // Commenting now, if needed , will enable in future
